    useEffect(()=>{
        const fetchData = async () => {
            try {
                const Response = await fetch('https://api.escuelajs.co/api/v1/products')
                const Data = await Response.json()
                setItems(Data)
            } catch (error) {
                console.log(error)
                console.log('No se pudo realizar la peticion')        
            }
        }
        fetchData();
    }, [])

    
    //Shoppinc car number
    const [count, setCount] = useState(0)

    //Product Detail - Open/close window of product detail
    const [isProductDetailOpen, setIsProductDetailOpen ] = useState(false)
    const openProductDetail = () => setIsProductDetailOpen(true)
    const closeProductDetail = () => setIsProductDetailOpen(false)

    //Show data in window of product detail
    const [showDataProducDetail, setShowDataProducDetail] = useState({})

    // Shopping car items - Add products
    const [shoppingCardProducts, setShoppingCardProducts] = useState([])
    
    //CarSide Menu - Open/close window 
    const [isCarSideMenuOpen, setIsCarSideMenuOpen] = useState(false)
    const openCarSideMenu = () => setIsCarSideMenuOpen(true)
    const closeCarSideMenu = () => setIsCarSideMenuOpen(false)

    // Shopping car Order.
    const [order, setOrder] = useState([]) //

    // I want to see a order, the actual order. 
    const [altualOrder, setActualOrder] = useState()

    //Search products by title
    const [searchBytitle, setSearchBytitle] = useState()
    console.log(searchBytitle)

    // I want to see only the filtered items 
    const [filteredItems, setFilteredItems] = useState()
    
    const filterItems  = (items, searchedValue) => {
        return items?.filter(item => item.title.toLowerCase().includes(searchedValue.toLowerCase()))
    }

    useEffect(() => {

        if (searchBytitle) {
            setFilteredItems(filterItems(items,searchBytitle))
        }

    },[searchBytitle]) // If that two states are actualiced, we set filter the items

    console.log(filteredItems);

    return(
        <ShoppingCartContext.Provider value = {{
            count,
            setCount,
            isProductDetailOpen,
            openProductDetail,
            closeProductDetail,
            showDataProducDetail,
            setShowDataProducDetail,
            shoppingCardProducts, 
            setShoppingCardProducts,
            isCarSideMenuOpen,
            openCarSideMenu,
            closeCarSideMenu,
            order,
            setOrder,
            setActualOrder,
            altualOrder,
            setItems,
            items,
            searchBytitle,
            setSearchBytitle,
            filteredItems

        }}>
            {children}
        </ShoppingCartContext.Provider>
    )
